import './App.css';
import Main from './components/Main';
import Filters from './components/Filters';
import Footer from './components/Footer';
import Contact from './components/Contact';
import AboutUs from './components/AboutUs';

function App() {
  return (
    <>
      <Main />
      <Filters />
      <AboutUs />
      <Contact />
      <Footer />
    </>
  );
}

export default App;
